import React from "react";

/*This function will:
    1)Take in cards and URL (for buttons)
    2)Map through them and return the JSX for each card
        Buttons should include:
            Edit card
            Delete
*/
export default function ShowCards({ cards, url }){

    console.log(cards)
    const deckCards = cards.map((card, index) => (
            <tr key={index}>
                <td>{card.front}</td>
                <td>{card.back}</td>
            </tr>
    ))

    return (
        <table>
            <th>Cards</th>
            {deckCards}
        </table>
    )
};
